import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function SignUp() {
    const [email, setEmail] = useState('');
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [houseNo, setHouseNo] = useState('');
    const [area, setArea] = useState('');
    const [city, setCity] = useState('');
    const [fullName, setFullName] = useState('');
    const [isDarkMode, setIsDarkMode] = useState(false);
    const navigate = useNavigate();

    useEffect(() => {
        // Check localStorage for the saved theme preference
        const savedTheme = localStorage.getItem('theme');
        if (savedTheme) {
            setIsDarkMode(savedTheme === 'dark');
        }
    }, []);

    const handleSubmit = (event) => {
        event.preventDefault();
        const address = { houseNo, area, city };
        const userData = { email, username, password, phoneNumber, fullName, address };
        axios
            .post('http://localhost:3001/register', userData)
            .then(() => {
                alert('Registration Successful');
                resetForm();
                navigate('/login');
            })
            .catch((error) => {
                console.log('Unable to register user', error);
            });
    };

    const resetForm = () => {
        setEmail('');
        setUsername('');
        setPassword('');
        setPhoneNumber('');
        setFullName('');
        setHouseNo('');
        setArea('');
        setCity('');
    };

    const toggleTheme = () => {
        const newTheme = isDarkMode ? 'light' : 'dark';
        setIsDarkMode(!isDarkMode);
        localStorage.setItem('theme', newTheme);
        document.documentElement.classList.toggle('dark', !isDarkMode);
    };

    return (
        <div className={`min-h-screen flex items-center justify-center ${isDarkMode ? 'bg-[#1a1a1a]' : 'bg-gray-100'} text-gray-800 dark:text-white transition-colors duration-300`}>
            <div className="w-full max-w-md bg-white dark:bg-gray-800 p-8 rounded-lg shadow-lg border border-gray-200 dark:border-gray-700">
                <h2 className="text-3xl font-semibold text-center text-teal-600 dark:text-teal-400 mb-6">Sign Up</h2>
                <form onSubmit={handleSubmit}>
                    {/* Full Name */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Full Name</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="Full Name"
                            value={fullName}
                            onChange={(e) => setFullName(e.target.value)}
                            required
                        />
                    </div>
                    {/* Email */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Email</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="email"
                            placeholder="Email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                        />
                    </div>
                    {/* Username */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Username</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="Username"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                            required
                        />
                    </div>
                    {/* Password */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Password</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="password"
                            placeholder="Password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    {/* Phone Number */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Phone Number</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="Phone Number"
                            value={phoneNumber}
                            onChange={(e) => setPhoneNumber(e.target.value)}
                            required
                        />
                    </div>
                    {/* House No */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">House No.</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="House No."
                            value={houseNo}
                            onChange={(e) => setHouseNo(e.target.value)}
                            required
                        />
                    </div>
                    {/* Area */}
                    <div className="mb-4">
                        <label className="block text-sm font-medium">Area</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="Area"
                            value={area}
                            onChange={(e) => setArea(e.target.value)}
                            required
                        />
                    </div>
                    {/* City */}
                    <div className="mb-6">
                        <label className="block text-sm font-medium">City</label>
                        <input
                            className="w-full mt-1 p-2 bg-gray-100 dark:bg-gray-700 text-black dark:text-white rounded-lg focus:ring-2 focus:ring-teal-500 focus:outline-none"
                            type="text"
                            placeholder="City"
                            value={city}
                            onChange={(e) => setCity(e.target.value)}
                            required
                        />
                    </div>
                    {/* Submit */}
                    <div className="flex justify-center mb-6">
                        <button className="w-full p-3 bg-teal-500 hover:bg-teal-600 text-white font-semibold rounded-lg transition duration-300">
                            Sign Up
                        </button>
                    </div>
                </form>

                {/* Theme Toggle */}
                <div className="flex justify-center">
                    <button 
                        className="p-2 bg-teal-500 text-white rounded-lg"
                        onClick={toggleTheme}
                    >
                        Toggle Theme
                    </button>
                </div>
            </div>
        </div>
    );
}

export default SignUp;
